(function (c) {
  "use strict";
  c(document).ready(function () {
    function i() {
      c("#invoice-print").on("click", function (i) {
        i.preventDefault();
        var n = c(this),
          e = n.data("invoice-id"),
          o = n.data("ajax-url"),
          t = window.open(
            "",
            "Invoice Print Window",
            "scrollbars=0,menubar=0,resizable=1,width=991 ,height=800"
          );
        c.ajax({
          type: "POST",
          url: o,
          data: {
            action: "felan_invoice_print_ajax",
            invoice_id: e,
            isRTL: c("body").hasClass("rtl") ? "true" : "false",
          },
          success: function (i) {
            t.document.write(i);
            t.document.close();
            t.focus();
          },
          error: function (i) {
            console.log(i);
          },
        });
      });
    }
    i();
  });
})(jQuery);
